eur>La hauteur des marches est la m&#xEA;me pour un escalier</valeur><valeur>cr_voirie_esca_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le giron est &gt;= &#xE0; 28 cm</valeur><valeur>cr_voirie_esca_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le nez de la premi&#xE8;re marche est visuellement contrast&#xE9;</valeur><valeur>cr_voirie_esca_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le nez de la derni&#xE8;re marche est visuellement contrast&#xE9;</valeur><valeur>cr_voirie_esca_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Tout escalier de 3 marches ou plus comporte deux mains courantes ou une main courante centrale </valeur><valeur>cr_voirie_esca_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Si l''escalier &#xE0; une largeur &gt; &#xE0; 420 cm alors il comporte au moins une main courante interm&#xE9;diaire</valeur><valeur>cr_voirie_esca_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>La largeur entre les mains courantes est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_esca_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>Les mains courantes d&#xE9;passent la premi&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>Les mains courantes d&#xE9;passent la derni&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_13</valeur><valeur>124</valeur