(56, 6, '<?xml version="1.0"?>\n<documents><rubrique id="1058" idParent="114">Troncon nord<motclef/><article id="1416">Troncon nord<date>2008-04-23 10:37:08</date><maj>2008-04-23 12:06:34</maj><auteur>5</auteur><donnees><grille>62</grille><champs><champ>ligne_1</champ><champ>ligne_3</champ><champ>ligne_2</champ><champ>ligne_4</champ><champ>ligne_5</champ><champ>select_1</champ></champs><donnee><date>2008-04-15 16:42:02</date><maj>2008-04-15 16:42:02</maj><valeur>Troncon nord</valeur><valeur>01</valeur><valeur>Toto</valeur><valeur>26</valeur><valeur>66</valeur><valeur>select_1_5</valeur></donnee></donnees></article><rubrique id="4559" idParent="1058">Escalier sur la voirie 12/05/08 - 17:34:13<motclef>132</motclef><article id="1785">Escalier sur la voirie 12/05/08 - 17:34:13<date>2008-05-12 17:34:13</date><maj>2008-05-13 16:58:49</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il ne comporte aucun mur de chaque c&#xF4;t&#xE9; alors la largeur minimale d''un escalier est de 120 cm</valeur><valeur>cr_voirie_esca_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il comporte un mur d''un seul c&#xF4;t&#xE9; alors la largeur minimale d''un escalier est de 130 cm</valeur><valeur>cr_voirie_esca_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il est plac&#xE9; entre deux murs alors la largeur minimale d''un escalier est de 140 cm</valeur><valeur>cr_voirie_esca_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>La hauteur des marches est inf&#xE9;rieur &#xE0; 16 cm</valeur><valeur>cr_voirie_esca_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><val