amp><champ>mot_20</champ><champ>mot_21</champ><champ>mot_22</champ><champ>mot_23</champ><champ>mot_24</champ><champ>mot_25</champ><champ>mot_26</champ><champ>mot_27</champ><champ>mot_4</champ><champ>mot_5</champ><champ>mot_6</champ><champ>mot_7</champ><champ>mot_9</champ><champ>ligne_1</champ></champs><donnee><date>2008-05-15 09:51:38</date><maj>2008-05-15 09:51:38</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>Bat test</valeur></donnee></donnees></article><rubrique id="4564" idParent="4563">Cabine principale<motclef/><article id="1792">Cabine principale<date>2008-05-15 09:52:05</date><maj>2008-05-15 09:52:18</maj><auteur>6</auteur><donnees><grille>65</grille><champs><champ>ligne_2</champ><champ>ligne_3</champ><champ>ligne_1</champ><champ>select_1</champ><champ>select_2</champ></champs><donnee><date>2008-05-15 09:52:05</date><maj>2008-05-15 09:52:05</maj><valeur/><valeur/><valeur>Cabine principale</valeur><valeur>select_1_3</valeur><valeur>select_2_1</valeur></donnee></donnees></article><rubrique id="4565" idParent="4564">Cabine ascenseur 15/05/08 - 09:52:18<motclef>125</motclef><article id="1793">Cabine ascenseur 15/05/08 - 09:52:18<date>2008-05-15 09:52:18</date><maj>2008-05-15 09:52:18</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-15 09:52:18</date><maj>2008-05-15 09:52:18</maj><valeur>Les commandes int&#xE9;rieures sont situ&#xE9;es sur le c&#xF4;t&#xE9; de la cabine ; &#xE0; droite (ouverture centrale) ou du c&#xF4;t&#xE9; de fermeture de la porte (si l''ascenseur est inf&#xE9;rieur &#xE0; 200 x 140 cm)</valeur><valeur>cr_asc_cab_01</valeur><valeur>2</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; une hauteur comprise entre 90 et 110 cm</valeur><valeur>cr_asc_cab_02</valeur><valeur>141</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; plus de 40 cm d''un angle rentrant ou d''un obstacle</valeur><valeur>cr_asc_cab_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes sont rep&#xE9;rables (visuellement et tactilement)</valeur><valeur>cr_asc_cab_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Le bouton indiquant le niveau de sortie est tactilement (en saillie) et visuellement (vert) contrast&#xE9; des autres commandes</valeur><valeur>cr_asc_cab_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures poss&#xE8;dent un t&#xE9;moin d''activation visuel et sonore</valeur><valeur>cr_asc_cab_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les boutons de commandes sont contrast&#xE9;s (visuellement et tactilement) par rapport &#xE0; leur support</valeur><valeur>cr_asc_cab_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>La cabine mesure au minimum 100 cm de largeur</valeur><valeur>cr_asc_cab_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>La cabine mesure au minimum 125 cm de profondeur devant chaque porte</valeur><valeur>cr_asc_cab_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Pr&#xE9;sence d''une main courante sur une