(91, 6, '<?xml version="1.0"?>\n<documents><rubrique id="1058" idParent="114" idAdmin="6">Troncon nord<motclef/><article id="1416" idRub="1058">Troncon nord<date>2008-04-23 10:37:08</date><maj>2008-04-23 12:06:34</maj><auteur>5</auteur><donnees><grille>62</grille><champs><champ>ligne_2</champ><champ>ligne_3</champ><champ>ligne_4</champ><champ>ligne_5</champ><champ>ligne_1</champ><champ>select_1</champ></champs><donnee><date>2008-04-15 16:42:02</date><maj>2008-04-15 16:42:02</maj><valeur/><valeur/><valeur/><valeur/><valeur>Troncon nord</valeur><valeur>select_1_7</valeur></donnee></donnees></article><rubrique id="4508" idParent="1058" idAdmin="">Cheminement sur la voirie 6/05/08 - 10:15:22<motclef>130</motclef><article id="1736" idRub="4508">Cheminement sur la voirie 6/05/08 - 10:15:22<date>2008-05-06 10:15:22</date><maj>2008-05-21 10:10:03</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le sol n''est pas meuble</valeur><valeur>cr_voirie_chem_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le rev&#xEA;tement n''est pas glissant</valeur><valeur>cr_voirie_chem_02</valeur><valeur>141</valeur></donnee><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le cheminement ne comporte pas d''obstacles au sol</valeur><valeur>cr_voirie_chem_03</valeur><valeur>1</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>S''il existe sur le cheminement des obstacles en porte-&#xE0;-faux alors ils laissent un passage libre &gt;= 220 cm de haut</valeur><valeur>cr_voirie_chem_04</valeur><valeur>2</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>S''il existe sur le cheminement des obstacles en saillie lat&#xE9;rale de plus de 15 cm laissant un passage libre inf &#xE0; 220 cm de hauteur, alors ils sont rappel&#xE9;s par un &#xE9;l&#xE9;ment bas install&#xE9; au max &#xE0; 40 cm du sol ou par une sur&#xE9;paisseur au sol d''au moins 3 cm</valeur><valeur>cr_voirie_chem_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pr&#xE9;sence d''un guide tactilement et visuellement constrat&#xE9; le long du cheminement</valeur><valeur>cr_voirie_chem_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>La largeur du cheminement est &gt;= &#xE0; 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si absence de murs et d''obstacles de part et d''autre du cheminement alors sa largeur est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_chem_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le devers est inf&#xE9;rieur ou &#xE9;gal &#xE0; 2%</valeur><valeur>cr_voirie_chem_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pente inf&#xE9;rieure &#xE0; 5%</valeur><valeur>cr_voirie_chem_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 8% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 2 m</valeur><valeur>cr_voirie_chem_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 12% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 50 cm</valeur><valeur>cr_voirie_chem_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en bas</valeur><valeur>cr_voirie_chem_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en haut</valeur><valeur>cr_voirie_chem_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors palier de repos tous les 10 m</valeur><valeur>cr_voirie_chem_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors pr&#xE9;sence d''un main courante ergonomique et constrat&#xE9;e</valeur><valeur>cr_voirie_chem_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier est horizontal</valeur><valeur>cr_voirie_chem_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier mesure 120 x 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement</valeur><valeur>cr_voirie_chem_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement poss&#xE8;de un espace de manoeuvre de 200 cm de diam&#xE8;tre</valeur><valeur>cr_voirie_chem_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si rupture de niveau de plus de 40 cm alors garde-corps le long de la rupture de niveau</valeur><valeur>cr_voirie_chem_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le garde 